import { Component } from '@angular/core';
import { IonicPage, NavController, NavParams, AlertController, MenuController, ViewController, LoadingController } from 'ionic-angular';
import { NgForm } from '@angular/forms';
import swal from 'sweetalert';
import { AuthProvider } from '../../providers/auth/auth';
import { NodeapiProvider } from '../../providers/nodeapi/nodeapi';
import firebase from 'firebase';


@IonicPage()
@Component({
  selector: 'page-register',
  templateUrl: 'register.html',
})
export class RegisterPage {
  user:any;
  check=true;
  checkEmail=true;
  loader;
  checkris=true;
  typeuser;
  constructor(public navCtrl: NavController, public navParams: NavParams,public AlertCtrl:AlertController,public menu:MenuController
  ,public viewCtrl:ViewController,private auth:AuthProvider,private api: NodeapiProvider,
  private loadingCtrl:LoadingController) {
  this.api.getUserAll().subscribe(data=>{
    if(data!=null){
    var values = Object.keys(data).map(key => data[key]);
    this.user = values;
    }
    else{
      this.user = [];
    }
  });
  this.menu=menu;
  this.menu.enable(false,'myMenu');

}
 ;
  ionViewDidLoad() {
    console.log('ionViewDidLoad RegisterPage');
  }
  reg(data:NgForm){
    console.log(this.user.length);
    let c=0;
    if(this.user.length != 0){
      for(let i=0;i<this.user.length;i++){
        if(data.value.user==this.user[i].user){
          c=c;
        }
        else{
          c++;
        }
      }
    }
    else
    {
      c = 0;
    }
      if(c==this.user.length){
        this.check=true;
        console.log('ERROR');
        if(data.value.fname!=''&&data.value.lname!=''&&data.value.user!=''&&data.value.pass!=''&&data.value.cpass!='')
        {
          this.presentLoading()
          if(this.typeuser ==1){

          {
          var logo_base64 = '';
          }
            firebase.storage().ref().child('/Photos/'+data.value.user+'/Logo')
              .putString(logo_base64, 'base64', { contentType: 'image/png' });
              setTimeout(()=>{
                firebase.storage().ref('/Photos/'+data.value.user+'/Logo').getDownloadURL().then(URL=>{
                  console.log(URL);
                  this.api.addBrandFarm(data.value.user,{farm_name_TH:'ฟาร์มคุณ'+data.value.fname
              ,farm_name_EN:'',farm_initial:'',farm_address:data.value.address,phone_num:data.value.phone_num
              ,logo_base64:URL}).subscribe();

            this.auth.doRegister(data.value.email,data.value.pass)
            .then(() => {
              this.checkEmail=true;
              data.value.privilege = 'เจ้าของฟาร์ม';
              this.api.addUser(data.value).subscribe();
              this.auth.login(data.value.email,data.value.pass);
              this.loader.dismiss();
              this.viewCtrl.dismiss();
              this.success();
            }, err => {
              console.log(err);
              this.checkEmail=false;
            })
          })
        },3000)
      }
      else{
        this.auth.doRegister(data.value.email,data.value.pass)
            .then(() => {
              data.value.adminfarm='ยังไม่มี';
              data.value.privilege = 'ยังไม่ได้อนุมัติ';
              data.value.count_login='1';
              this.checkEmail=true;
              this.api.addUser(data.value).subscribe();
              //this.auth.login(data.value.email,data.value.pass);
              this.loader.dismiss();
              this.viewCtrl.dismiss();
              this.success();
            }, err => {
              console.log(err);
              this.checkEmail=false;
            })
      }
        }
        else{
          this.error();
        }
      }
      else{
        this.check=false;
      }
      console.log(c,this.user.length);


}

error(){
  swal("ข้ออภัย!", "กรุณากรอกข้อมูลให้ครบถ้วน", "error");
}
success(){
    swal("เสร็จสิ้น!", "สมัครผู้ใช้งานเรียบร้อยแล้ว", "success");
}
presentLoading() {
  this.loader = this.loadingCtrl.create({
    content: "กรุณารอสักครู่...",
  });
  this.loader.present();

}
prev(n){
  this.checkris=false;
  console.log(n);
  this.typeuser = n;
}
back(a){
  this.checkris=true;
}
}
